int
handle_jmfcSystemVersion(netsnmp_mib_handler *handler,
                          netsnmp_handler_registration *reginfo,
                          netsnmp_agent_request_info   *reqinfo,
                          netsnmp_request_info         *requests)
{
    uint32 size = 0;
    u_char *data = NULL;
    /* We are never called for a GETNEXT if it's registered as a
       "instance", as it's "magically" handled for us.  */

    /* a instance handler also only hands us one request at a time, so
       we don't need to loop over a list of requests; we'll only get one. */
    
    switch(reqinfo->mode) {

        case MODE_GET:

	    data = (u_char *) NKN_BUILD_PROD_RELEASE;
	    size = strlen(NKN_BUILD_PROD_RELEASE);
            snmp_set_var_typed_value(requests->requestvb, ASN_OCTET_STR,
                                     (u_char *)data /* XXX: a pointer to the scalar's data */,
                                     size/* XXX: the length of the data in bytes */);
            break;


        default:
            /* we should never get here, so this is a really bad error */
            snmp_log(LOG_ERR, "unknown mode (%d) in handle_jmfcSystemVersion\n", reqinfo->mode );
            return SNMP_ERR_GENERR;
    }

    return SNMP_ERR_NOERROR;
}
int
handle_jmfcSystemId(netsnmp_mib_handler *handler,
                          netsnmp_handler_registration *reginfo,
                          netsnmp_agent_request_info   *reqinfo,
                          netsnmp_request_info         *requests)
{
    uint32 size = 0;
    u_char *data = NULL;
    bn_binding *binding = NULL;
    char *trigger_type = NULL;
    int err = 0;
    uint32 code = 0;

    /* We are never called for a GETNEXT if it's registered as a
       "instance", as it's "magically" handled for us.  */

    /* a instance handler also only hands us one request at a time, so
       we don't need to loop over a list of requests; we'll only get one. */
    
    switch(reqinfo->mode) {

        case MODE_GET:
	    err = mdc_get_binding(sn_get_admin_mcc(), &code, NULL, false, &binding,
		    "/system/hostid", NULL);
	    bail_error(err);
	    if (binding) {
		err = bn_binding_get_str(binding, ba_value, bt_string, NULL, &trigger_type);
		bail_error(err);
		bn_binding_free(&binding);
	    }
	    if (trigger_type) {
		data = (u_char *) trigger_type;
		size = strlen(trigger_type);
	    } else {
		data = (u_char *)"0000000000000000";
		size = strlen("0000000000000000");
	    }
            snmp_set_var_typed_value(requests->requestvb, ASN_OCTET_STR,
                                     (u_char *) data/* XXX: a pointer to the scalar's data */,
                                     size/* XXX: the length of the data in bytes */);
            break;


        default:
            /* we should never get here, so this is a really bad error */
            snmp_log(LOG_ERR, "unknown mode (%d) in handle_jmfcSystemId\n", reqinfo->mode );
            return SNMP_ERR_GENERR;
    }

bail:
    safe_free(trigger_type);
    return SNMP_ERR_NOERROR;
}
